package com.itheima.ssm.domain;/** * 旅客表信息 * @auther wangyang * @date 2019/10/22 11:54 PM */public class Traveller {    private String id;    private String name;    private String sex;    private String phoneNum;    private Integer credentialsType;    private String credentialsTypeStr;    private String credentialsNum;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getSex() {        return sex;    }    public void setSex(String sex) {        this.sex = sex;    }    public String getPhoneNum() {        return phoneNum;    }    public void setPhoneNum(String phoneNum) {        this.phoneNum = phoneNum;    }    public Integer getCredentialsType() {        return credentialsType;    }    public void setCredentialsType(Integer credentialsType) {        this.credentialsType = credentialsType;    }    public String getCredentialsTypeStr() {        return credentialsTypeStr;    }    public void setCredentialsTypeStr(String credentialsTypeStr) {        this.credentialsTypeStr = credentialsTypeStr;    }    public String getCredentialsNum() {        return credentialsNum;    }    public void setCredentialsNum(String credentialsNum) {        this.credentialsNum = credentialsNum;    }    public Integer getTravellerType() {        return travellerType;    }    public void setTravellerType(Integer travellerType) {        this.travellerType = travellerType;    }    public String getTravellerTypeStr() {        return travellerTypeStr;    }    public void setTravellerTypeStr(String travellerTypeStr) {        this.travellerTypeStr = travellerTypeStr;    }    private Integer travellerType;    private String travellerTypeStr;}